/*
	avalon组件,fy-alert模态弹框.
	open() 用于自定义,传入整个对象,参数会有默认值.
	show() wiat() error() warn() 自带一些默认值,
	传入按钮的function 并且 没有showtime的时候 会显示按钮,
	传入showtime时候 会自动关闭alert.
 */
 avalon.component('fy-alert', {
	template: (function(){
		var content="<div>"+
						"<div class=\"sweet-overlay\" ms-visible=\"@isShow\"></div>"+
						"<div class=\"sweet-alert showSweetAlert animated\" ms-class=\"@animateCss\" ms-visible=\"@isShow\" ms-css=\"{zIndex:@zIndex}\">"+
							"<div class=\"sa-icon sa-error\" ms-visible=\"@tip.iconType=='error'\">"+
								"<span class=\"sa-x-mark\">"+
									"<span class=\"sa-line sa-left\"></span>"+
									"<span class=\"sa-line sa-right\"></span>"+
								"</span>"+
							"</div>"+
							"<div class=\"sa-icon sa-success animate\" ms-visible=\"@tip.iconType=='success'\">"+
								"<span class=\"sa-line sa-tip animateSuccessTip\"></span>"+
								"<span class=\"sa-line sa-long animateSuccessLong\"></span>"+
								"<div class=\"sa-placeholder\"></div>"+
								"<div class=\"sa-fix\"></div>"+
							"</div>"+
							"<div class=\"sa-icon sa-warning pulseWarning\" ms-visible=\"@tip.iconType=='warn'\">"+
								"<span class=\"sa-body pulseWarningIns\"></span>"+
								"<span class=\"sa-dot pulseWarningIns\"></span>"+
							"</div>"+
							"<div class=\"sa-icon sa-custom\" ms-visible=\"@tip.iconType=='wait'\">"+
								"<img ms-attr=\"{src:@waitImg}\" style=\"width:80px;height:80px;'\" />"+
							"</div>"+
							"<i class=\"icon-collapse-alt icon-large modal-close\" ms-visible=\"@showOk\" ms-click=\"@_onClose()\"></i>"+
							"<h2>{{@tip.title}}</h2>"+
							"<p ms-visible=\"@tip.text!=''\">{{@tip.text}}</p>"+
							"<div class=\"sa-button-container\">"+
								"<button type=\"button\" class=\"cancel\" ms-click=\"@onClose()\" ms-visible=\"(!@autoClose&&@tip.iconType!='wait')&&((@tip._onConfirm!=avalon.noop&&@tip._onClose==avalon.noop)||(@tip._onConfirm==avalon.noop&&@tip._onClose==avalon.noop))\">关闭</button>"+
								"<button type=\"button\" class=\"confirm\" ms-click=\"@onConfirm()\" ms-visible=\"@tip._onConfirm!=avalon.noop&&!@autoClose\">确定</button>"+
							"</div>"+
						"</div>"+
					"</div>";
		return content;
	}).call(this),
	defaults: {
		// 控制modal-tip的显示
		isShow:false,
		autoClose:false,
		zIndex:10000,
		tip:{
			title:"执行成功",
			text:"请稍等......",
			iconType:"success",
			_onClose:avalon.noop,
			_onConfirm:avalon.noop,
		},
		$timeId:0,
		animateCss:"",
		animate:{
			show:"fadeInUp",
			hide:"fadeOutDown",
			time:500
		},
		onClose:function(){
			this.hide();
			this.tip._onClose.call(this);
		},
		onConfirm:function(){
			this.hide();
			this.tip._onConfirm.call(this);
		},
		clearTimeout:function(){
			if(this.$timeId!=0){
				clearTimeout(this.$timeId);
				this.$timeId=0;
			}
		},
		show:function(sTitle,sText,fnConfirm,fnClose,iShowTime){//显示success
			this.zIndex=avalon.zIndex++;
			iShowTime=iShowTime||0;
			this.clearTimeout();
			this.tip={
				title:sTitle||"执行成功",
				text:sText||"请稍等...",
				iconType:"success",
				_onClose:fnClose||avalon.noop,
				_onConfirm:fnConfirm||avalon.noop,
			};
			this.animateCss=this.animate.show;
			this.isShow=true;
			this.autoClose=iShowTime>0;
			if(this.autoClose){
				this.autoHide(fnConfirm,iShowTime);
			}
		},
		autoHide:function(fnConfirm,iShowTime){//自动关闭
			fnConfirm=fnConfirm||avalon.noop;
			iShowTime=iShowTime||1000;
			var oSelf=this;
			this.$timeId=setTimeout(function(){
				oSelf.hide();
				fnConfirm.call(oSelf);
			},iShowTime);
		},
		hide:function(){
			this.animateCss=this.animate.hide;
			if(this.animate.time>0){
				var oSelf=this;
				this.$timeId=setTimeout(function(){
					oSelf.$timeId=0;
					oSelf.isShow=false;
				},this.animate.time);
			}else{
				this.isShow=false;
			}
		},
		wait:function(sTitle,sText,fnConfirm,fnClose,iShowTime){
			this.zIndex=avalon.zIndex++;
			iShowTime=iShowTime||0;
			this.clearTimeout();
			this.tip={
				title:sTitle||"正在执行",
				text:sText||"请稍等...",
				iconType:"wait",
				_onClose:fnClose||avalon.noop,
				_onConfirm:fnConfirm||avalon.noop,
			};
			this.animateCss=this.animate.show;
			this.isShow=true;
			this.autoClose=iShowTime>0;
			if(this.autoClose){
				this.autoHide(fnConfirm,iShowTime);
			}
		},
		warn:function(sTitle,sText,fnConfirm,fnClose,iShowTime){
			this.zIndex=avalon.zIndex++;
			iShowTime=iShowTime||0;
			this.clearTimeout();
			this.tip={
				title:sTitle||"警告",
				text:sText||"",
				iconType:"warn",
				_onClose:fnClose||avalon.noop,
				_onConfirm:fnConfirm||avalon.noop,
			};
			this.animateCss=this.animate.show;
			this.isShow=true;
			this.autoClose=iShowTime>0;
			if(this.autoClose){
				this.autoHide(fnConfirm,iShowTime);
			}
		},
		error:function(sTitle,sText,fnConfirm,fnClose,iShowTime){
			this.zIndex=avalon.zIndex++;
			iShowTime=iShowTime||0;
			this.clearTimeout();
			this.tip={
				title:sTitle||"执行失败",
				text:sText||"",
				iconType:"error",
				_onClose:fnClose||avalon.noop,
				_onConfirm:fnConfirm||avalon.noop
			};
			this.animateCss=this.animate.show;
			this.isShow=true;
			this.autoClose=iShowTime>0;
			if(this.autoClose){
				this.autoHide(fnConfirm,iShowTime);
			}
		},
		$tip:{
			title:"执行成功",
			text:"请稍等......",
			iconType:"success",
			_onClose:avalon.noop,
			_onConfirm:avalon.noop
		},
		open:function(oOption){
			this.zIndex=avalon.zIndex++;
			this.clearTimeout();
			this.tip=avalon.mix(this.$tip,oOption);
			this.animateCss=this.animate.show;
			this.isShow=true;
			this.autoClose=(oOption["showtime"]&&oOption["showtime"]>0);
			if(this.autoClose){
				this.autoHide(oOption["_onConfirm"],oOption.showtime);
			}
		},
		onReady:function(){
			
		},
		waitImg:"data:image/gif;base64,"
	},
});
// 动态创建组件
avalon.getAlert=function(sComId){
	return avalon.createComponent("fy-alert",sComId);
};
avalon.openAlertWait=function(){
	var oAlert=avalon.getAlert();
	if(oAlert) oAlert.wait();
	return oAlert;
};